  "text" : "\"\uAE40\uD604 \uC2DC\uC778\uC740 \uC6B0\uB9AC \uBAA8\uB450\uAC00 \u201C\uC7A0\uC7AC\uC801 \uBC29\uAD00\uC790\u201D\uB77C\uBA70 \uB2E4\uC74C\uACFC \uAC19\uC740 \uC81C\uC5B8\uC73C\uB85C \uAE00\uC744 \uB9FA\uB294\uB2E4. \u201C\uBB38\uB2E8\uC758 \uD398\uBBF8\uB2C8\uC2A4\uD2B8 \uC5EC\uB7EC\uBD84! \uBB38\uB2E8\uC5D0\uC11C \uBC8C\uC5B4\uC9C4 \uC5EC\uC131\uD610\uC624, \uBC94\uC8C4 \uAE30\uB85D\uBB3C\uC744 \u2018\uB3C5\uB9BD\uC801\uC73C\uB85C\u2019 \uB9CC\uB4E4\uC5B4\uBCF4\uB294 \uAC74 \uC5B4\uB5A8\uAE4C\uC694? \u201C\uC6B0\uB9AC\uC5D0\uAC90 \uD544\uC694\uD55C \uC5B8\uC5B4\u201D\uAC00 \uC788\uC9C0 \uC54A\uC2B5\uB2C8\uAE4C?\u201D\"",
