  "text" : "\"\uD55C\uB54C \uC138\uACC4 \uBC14\uAE65\uC758 \uC5B8\uC5B4\uB97C \uC4F0\uB294 \uC0AC\uB78C\uB4E4\uC774 \uC65C \uC138\uACC4\uC758 \uD3ED\uB825\uC744 \uADF8\uB300\uB85C \uB2F5\uC2B5\uD558\uB294\uC9C0 \uC758\uBB38\uC744 \uAC00\uC9C4\uC801\uC774 \uC788\uB2E4. \uBB38\uD559\uC774 \uC778\uAC04\uACFC \uC138\uACC4\uC5D0 \uB300\uD55C \uC778\uC2DD\uC758 \uC9C0\uD3C9\uC744 \uB113\uD788\uB294\uAC83\uC774\uB77C \uD560\uB54C, \uADF8 \uC778\uAC04\uACFC \uC138\uACC4\uC5D0 \uB2F9\uC5F0\uD788 \uC5EC\uC790\uB3C4 \uD3EC\uD568\uB420\uAC70\uB780 \uAE30\uB300\uAC00 \uB204\uAD70\uAC00\uC5D0\uAC90 \uC5BC\uD1A0\uB2F9\uD1A0 \uC54A\uC740 \uC77C\uC774\uC5C8\uB098\uBCF4\uB2E4.\"",
